import React from 'react'
import './HeaderLinks.css'

const HeaderLinks = ({onMenuItemClick}) => {
  return (
    <div className='header-menu'>
        <button class="menu-link is-active main-header-link" onClick={() => onMenuItemClick('About')}>About Me</button>
        <button class="menu-link" onClick={() => onMenuItemClick('Portfolio')}>Portfolio</button>
    </div>
  )
}

export default HeaderLinks
